import React from 'react';
import styles from '../../styles/layout/NavbarBtn.module.scss';

const Button = (props) => {
	return (
        <button 
            onClick={props.onClick} 
            className={props.alternative ? styles.alternative : styles.navbar}
            >
			{props.children}
		</button>
	);
};

export default Button;
